  }

  render (){
    return (
        <div className="text-center m-24 max-w-3xl mx-auto p-3">
            <div className="p-4 font-bold text-5xl">
                <span className='text-blue-500 font-mono'>Watermango</span> is a easy way to keep your office plants watered</div>

            <div className='mt-20 w-full p-8 border-2 border-gray-200 rounded-3xl text-left'>
                <h3 className='-mt-3 p-2 text-2xl font-bold'>Flowers:</h3>
                <div className='flex justify-evenly gap-4'>
                    <div className='w-full h-72 p-3 bg-gray-100 rounded-3xl'>
                        <div className="w-24 h-24 border border-gray-200 bg-gray-50 rounded-3xl"></div>
                    </div>
                    <div className='w-full h-72 bg-gray-100 rounded-3xl'></div>
                    <div className='w-full h-72 bg-gray-100 rounded-3xl'></div>
                </div>
            </div>
        </div>
    );
  }
}

export default Landing;
